    false,nt"url": null,nt"notes": "Features represent vegetation mapping for
    the Cow Creek Riparian Corridor, as specified for the Project Area designated in
    the contract between Stillwater Sciences and USFWS (USFWS Agreement No. 81330AJ365).
    Original mapping was performed by AIS, using 2010 NAIP imagery (1-m resolution).
    Stillwater performed an accuracy assessment in the field, and updated the vegetation
    mapping based on the observed conditions (Summer, 2013). Updates to the original
    file were made based on two sets of field data: 1) AA plot: the more complete field
    data collected at AA field plots using a modified version of the CNPS Rapid Assessment
    Protocol and randomly selected from stratified population of polygons in each reach,
    and based on land owner access agreements; and 2) map annotation: made on field
    maps in the field based on observed dominant species within the polygon.The data
    is mapped in the National Vegetation Classification System (NVCS) to the Alliance
    level, as depicted in the second edition of the Manual of California Vegetation.The
    data steward for this map is Trisha Parker, USFWS.AttributeDescriptionUIDUnique
    identification number assigned to each polygonAIS_VegTypOriginal vegetation classification
    based on AIS typingSWS_VegTypStillwater Science vegetation classification based
    on fieldworkSWS_noteStillwater Sciences note about vegetationAA_ScoreAccuracy assessment
    score of AIS type assigned based on field observation using 5 tier scoring per CDFW
    protocolObsTypeObservation source (AIS: original observation using aerial imagery;
